import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../api';


export default function Home(){
const [city, setCity] = useState('');
const [name, setName] = useState('');
const [email, setEmail] = useState('');
const [contact, setContact] = useState('');
const [gender, setGender] = useState('male');
const [password, setPassword] = useState('');
const [roleReg, setRoleReg] = useState('user');
const [error, setError] = useState('');

// Login side
const [emailLogin, setEmailLogin] = useState('');
const [passwordLogin, setPasswordLogin] = useState('');
const [roleLogin, setRoleLogin] = useState('user');
const [errorLogin, setErrorLogin] = useState('');
const navigate = useNavigate();
const onSearch = (e)=>{
e.preventDefault();
// move to /search?city=name
navigate(`/search?city=${encodeURIComponent(city)}`);
}
return (
<main className="container">
<section className="hero">
<h2>Welcome to PG Connect</h2>
<div style={{ display:'grid', gridTemplateColumns:'1fr 1fr', gap:20 }}>
<div>
<div className="search-form" style={{ flexDirection:'column', alignItems:'stretch' }}>
<h3 style={{ margin:'0 0 8px' }}>Create your account</h3>
<div style={{ display:'flex', gap:12, alignItems:'center', marginBottom:4 }}>
<label style={{ color:'#cbd5e1' }}>Register as:</label>
<label style={{ display:'flex', gap:6, alignItems:'center' }}><input type="radio" name="role-reg" value="user" checked={roleReg==='user'} onChange={()=>setRoleReg('user')} /> User</label>
<label style={{ display:'flex', gap:6, alignItems:'center' }}><input type="radio" name="role-reg" value="admin" checked={roleReg==='admin'} onChange={()=>setRoleReg('admin')} /> Admin</label>
</div>
<input placeholder="Full name" value={name} onChange={e=>setName(e.target.value)} />
<input type="email" placeholder="Email" value={email} onChange={e=>setEmail(e.target.value)} />
<input placeholder="Contact number" value={contact} onChange={e=>setContact(e.target.value)} />
<div style={{ display:'flex', gap:12, alignItems:'center' }}>
<label style={{ color:'#cbd5e1' }}>Gender:</label>
<label style={{ display:'flex', gap:6, alignItems:'center' }}><input type="radio" name="gender-home" value="male" checked={gender==='male'} onChange={()=>setGender('male')} /> Male</label>
<label style={{ display:'flex', gap:6, alignItems:'center' }}><input type="radio" name="gender-home" value="female" checked={gender==='female'} onChange={()=>setGender('female')} /> Female</label>
</div>
<input type="password" placeholder="Create password" value={password} onChange={e=>setPassword(e.target.value)} />
<button onClick={async()=>{
  setError('');
  try{
    if(!name || !email || !contact || !gender || !password){ setError('Please fill all fields'); return; }
    const res = await api.post('/auth/register', { name, email, contact, gender, password, role: roleReg });
    localStorage.setItem('token', res.data.token);
    localStorage.setItem('email', res.data.email);
    localStorage.setItem('role', res.data.role || 'user');
    navigate('/');
  }catch(err){
    setError(err?.response?.data?.message || 'Signup failed');
  }
}}>
{roleReg==='admin' ? 'Register as Admin' : 'Register as User'}
</button>
{error && <p style={{ color:'#ff9aa2', marginTop: 8 }}>{error}</p>}
<p style={{ marginTop: 8, color:'#9fb0c7' }}>Already have an account? Use the Login form →</p>
</div>
</div>
<div>
<div className="search-form" style={{ flexDirection:'column', alignItems:'stretch' }}>
<h3 style={{ margin:'0 0 8px' }}>Login</h3>
<div style={{ display:'flex', gap:12, alignItems:'center', marginBottom:4 }}>
<label style={{ color:'#cbd5e1' }}>Login as:</label>
<label style={{ display:'flex', gap:6, alignItems:'center' }}><input type="radio" name="role-login" value="user" checked={roleLogin==='user'} onChange={()=>setRoleLogin('user')} /> User</label>
<label style={{ display:'flex', gap:6, alignItems:'center' }}><input type="radio" name="role-login" value="admin" checked={roleLogin==='admin'} onChange={()=>setRoleLogin('admin')} /> Admin</label>
</div>
<input type="email" placeholder="Email" value={emailLogin} onChange={e=>setEmailLogin(e.target.value)} />
<input type="password" placeholder="Password" value={passwordLogin} onChange={e=>setPasswordLogin(e.target.value)} />
<button onClick={async()=>{
  setErrorLogin('');
  try{
    if(!emailLogin || !passwordLogin){ setErrorLogin('Please enter email and password'); return; }
    const res = await api.post('/auth/login', { email: emailLogin, password: passwordLogin, role: roleLogin });
    localStorage.setItem('token', res.data.token);
    localStorage.setItem('email', res.data.email);
    localStorage.setItem('role', res.data.role || roleLogin);
    navigate('/');
  }catch(err){
    setErrorLogin(err?.response?.data?.message || 'Login failed');
  }
}}>
{roleLogin==='admin' ? 'Login as Admin' : 'Login as User'}
</button>
{errorLogin && <p style={{ color:'#ff9aa2', marginTop: 8 }}>{errorLogin}</p>}
</div>
</div>
</div>
</section>
<section>
<form onSubmit={onSearch} className="search-form" style={{ maxWidth: 600 }}>
<input required placeholder="Search by city name" value={city} onChange={e=>setCity(e.target.value)} />
<button type="submit">Search</button>
</form>
</section>
<section>
<h3>About</h3>
<p>PG Connect links seekers to verified PG owners. Admins can register properties and manage availability seamlessly.</p>
</section>
</main>
);
}
